      title: '新增收货地址',
      topBackgroundColor: '#222222',
      color: '#FFFFFF',
      backImage: '/static/images/return.png',
      userName: '请输入收货人姓名',
      userPhone: '请输入收货人手机号',
      select: '省-市-区/县',
      multiIndex: [0, 0, 0],
      province: '', //省id
      province_cn: '', //省中文
      city: '', //市id
      city_cn: '', //市中文
      area: '', //区id
      area_cn: '', //区中文
      detailedAddress: '', //详细地址
